uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_complexity;
uniform float u_transparency;
uniform float u_glow_intensity;

out vec4 fragColor;

// --- Math Utilities ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float sdSphere(vec3 p, float s) {
    return length(p) - s;
}

// Gyroid formula: sin(x)cos(y) + sin(y)cos(z) + sin(z)cos(x)
float gyroid(vec3 p, float scale, float thickness, float bias) {
    p *= scale;
    return abs(dot(sin(p), cos(p.yzx)) - bias) / scale - thickness;
}

// Fractal Tech logic combining gyroids at multiple scales
float map(vec3 p) {
    // Rotate the whole structure slowly
    p.xz *= rot(iTime * 0.1 * u_speed);
    p.xy *= rot(iTime * 0.07 * u_speed);

    // Base Globe bounding
    float globe = sdSphere(p, 3.5);

    // Fractal Gyroid Layers
    float g1 = gyroid(p, 1.5, 0.05, 0.5);
    float g2 = gyroid(p + 1.2, 3.2, 0.03, 0.3);
    float g3 = gyroid(p * 2.1, 6.4, 0.01, 0.1);

    // Combine layers (Tech Fractal)
    float tech = max(g1, -g2); // Subtractive patterns
    tech = min(tech, g2);      // Additive details
    tech = mix(tech, g3, 0.3); // Micro-details

    // Mask by the globe sphere
    return max(globe, tech * u_complexity);
}

// Normal calculation for lighting
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    // 1. Correct Aspect Ratio UVs
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // 2. Camera Setup
    vec3 ro = vec3(0.0, 0.0, -8.0); // Camera position
    vec3 ta = vec3(0.0, 0.0, 0.0);  // Look target

    // Mouse rotation
    float mx = iMouse.z > 0.0 ? (iMouse.x / iResolution.x - 0.5) * 6.28 : 0.0;
    float my = iMouse.z > 0.0 ? (iMouse.y / iResolution.y - 0.5) * 3.14 : 0.0;
    ro.yz *= rot(my);
    ro.xz *= rot(mx);

    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f + uv.x * r + uv.y * u);

    // 3. Raymarching
    float t = 0.0;
    float glow = 0.0;
    float dist = 0.0;
    vec3 p;

    for(int i = 0; i < 80; i++) {
        p = ro + rd * t;
        dist = map(p);

        // Accumulate glow for transparency effect
        // The closer the ray passes to a surface, the more glow
        glow += exp(-dist * 4.0) * u_glow_intensity;

        if(dist < 0.001 || t > 20.0) break;
        t += dist * 0.6; // Relaxed step for smoother transparency feel
    }

    // 4. Shading & Coloring
    vec3 col = vec3(0.0);

    if(t < 20.0) {
        vec3 n = getNormal(p);
        vec3 l = normalize(vec3(1.0, 1.0, -1.0)); // Light dir

        // Tech-style Rim Lighting
        float rim = pow(1.0 - max(dot(n, -rd), 0.0), 3.0);
        float diff = max(dot(n, l), 0.0);

        // Base color (Cyan/Blue Tech Scheme)
        vec3 baseColor = mix(vec3(0.1, 0.4, 0.8), vec3(0.0, 1.0, 0.9), sin(p.z * 0.5 + iTime) * 0.5 + 0.5);

        col = baseColor * diff;
        col += vec3(0.5, 0.8, 1.0) * rim * 2.0; // Strong tech rim

        // Subtle texture from iChannel0
        vec3 tex = texture(iChannel0, p.xy * 0.1 + p.z * 0.1).rgb;
        col += tex * 0.1;

        // Transparency / Alpha simulation
        float alpha = clamp(u_transparency + rim, 0.0, 1.0);
        col *= alpha;
    }

    // Add procedural background star/grid pulse
    float bg = pow(clamp(dot(rd, vec3(0.0, 0.0, 1.0)), 0.0, 1.0), 10.0) * 0.2;
    col += vec3(0.05, 0.1, 0.2) * bg;

    // Apply accumulated glow
    col += vec3(0.1, 0.5, 1.0) * glow * 0.02;

    // 5. Post Processing
    col = pow(col, vec3(0.4545)); // Gamma correction
    col *= 1.2 - length(uv) * 0.5; // Vignette

    fragColor = vec4(col, 1.0);
}
